function deleteRow(){
	//删除的行
	var selectRow = TimeRegionPar_dg1459214611112Widget.getSelectedRow();
	if(selectRow==undefined) {
		CUI.Dialog.alert('${getText("foundation.message.choicedel")}');
		return false;
	}

	var regionPartId=TimeRegionPar_dg1459214611112Widget.getCellValue(TimeRegionPar_dg1459214611112Widget.getSelectedRow(),'id');
	var regionName=TimeRegionPar_dg1459214611112Widget.getCellValue(TimeRegionPar_dg1459214611112Widget.getSelectedRow(),'name');
	if(regionPartId!=undefined && regionPartId!=''){
	var url = "/X6Basic/timeRegion/timeRegionPar/deleteRegionPart.action?regionPartId="+regionPartId;
	var appointResult="";
		$.ajax({
		url : url,
		type : 'get',
		async : false,
		success : function(msg) {
		if(msg!=null){
		 appointResult = msg.result;
		}
		}
	});		
	if(appointResult==true){
		workbenchErrorBarWidget.showMessage('${getText("X6Basic.timeRegion.radion13714627349283","'+regionName+'")}')//不能录入重复的物品编码为['+productCode+']、货位编码为['+placeSetCode+']的数据行！
		return false;
	} 
	}
	//删行
   DT_TimeRegionPar_dg1459214611112_deldatagrid();
}

